import React from 'react';
import './LoginSignup.css';
const LoginSignup = () => {
    return (
        <div className='login-signup'>
        <div className="loginsignup-container">
            <h1>Sign Up</h1>
            <div className="loginsignup-fileds">
                <input type="text" placeholder=" Name" />
            </div>
        </div>
        </div>
    )
}

export default LoginSignup
